                <div className="text-center">
                    <h1 className="fw-bold mb-3">Welcome to Amazon Clone</h1>
                    <p className="lead mb-4">Shop your favorite products at lightning speed.</p>
                    <div className="btn btn btn-outline-light px-4 py-2">
                        Start Shopping
                    </div>
                </div>
            </div>
        </section>
        </>
    );
}
